import { configureStore } from '@reduxjs/toolkit'
import notifReducer from './reducers/notifReducer.js'
import userReducer from './reducers/'
const store = configureStore({
    reducer: {
        notifs: notifReducer,
        user: userReducer 
    }
})

export default store
